import Container from '../components/container';

const Index = (props) => {
    return(
        <Container>
            <h1>Index</h1>
        </Container>
    )
}

Index.getInitialProps = async (ctx) => {
    const res = await fetch('https://jsonplaceholder.typicode.com/users');
    const data = await res.json();
    console.log(data);
    return { users: data };
}

export default Index
